import React from 'react'
import {BrowserRouter as Router} from 'react-router-dom';
import {DataProvider} from './GlobalState'

export default function App() {
  return (
    <DataProvider>
      <Router></Router>
    <div>
      <h1>Hello World</h1>
    </div>
    </DataProvider>
  )
}
